      <div className="container-fluid">
        <button className="navbar-toggler" type="button"
          data-bs-toggle="collapse" data-bs-target="#navbarTogglerDemo01"
          aria-controls="navbarTogglerDemo01" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarTogglerDemo01">
          <Link to="/" className="navbar-brand">School Management</Link>
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <Link to="/" className="nav-link active" >Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/about"className="nav-link active" >About Us</Link>
            </li>
            <li className="nav-item">
              <Link to="/contact" className="nav-link active" >Contact</Link>
            </li>

            <li className="nav-item">
              <a className="nav-link active" >Services</a>
            </li>
          </ul>
          <form className="d-flex">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button className="btn btn-outline-success" type="submit">Search</button>
            <button className="btn btn-outline-defaulte" >Signup</button>
            <button className="btn btn-outline-defaulte" >Login</button>

          </form>
        </div>
      </div>
    </nav>

      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/about" element = {<About />}></Route>
        <Route path="/contact" elements = {<Contact />}></Route>
        <Route path="/services" elements = {<Service />}></Route>
      </Routes>
    </BrowserRouter>


  )
}
